INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2030/12/17 14:59:59", 1, 0.0, -363.0, 7, 0.0, "キャル", 0, 7001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2030/12/17 14:59:59", 1, 0.0, -363.0, 7, 0.0, "コッコロ", 0, 7002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2030/12/17 14:59:59", 1, 0.0, -363.0, 7, 0.0, "ペコリーヌ", 0, 7003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 10, 0.0, "ペコリーヌ", 0, 10001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 10, 0.0, "キャル", 0, 10002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2030/12/17 14:59:59", 1, 0.0, -363.0, 10, 0.0, "コッコロ", 0, 10003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2030/12/17 14:59:59", 1, 0.0, -363.0, 10, 0.0, "シェフィ", 2104010, 10004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2030/12/17 14:59:59", 1, 0.0, -416.5, 12, 0.0, "ペコリーヌ", 0, 12001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2030/12/17 14:59:59", 1, 0.0, -363.0, 13, 0.0, "キャル", 0, 13001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2030/12/17 14:59:59", 1, 0.0, -363.0, 13, 0.0, "コッコロ", 0, 13002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2030/12/17 14:59:59", 1, 0.0, -363.0, 13, 0.0, "シェフィ", 2104010, 13003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2030/12/17 14:59:59", 1, 0.0, -363.0, 13, 0.0, "ペコリーヌ", 0, 13004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2030/12/17 14:59:59", 1, 0.0, -363.0, 14, 0.0, "コッコロ", 0, 14001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 14, 0.0, "シェフィ", 2104010, 14002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 14, 0.0, "ペコリーヌ", 0, 14003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 14, 0.0, "キャル", 0, 14004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2030/12/17 14:59:59", 1, 0.0, -470.0, 15, 0.0, "コッコロ", 0, 15001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2030/12/17 14:59:59", 1, 0.0, -363.0, 16, 0.0, "シェフィ", 2104010, 16001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 16, 0.0, "ペコリーヌ", 0, 16002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2030/12/17 14:59:59", 1, 0.0, -363.0, 16, 0.0, "キャル", 0, 16003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2030/12/17 14:59:59", 1, 0.0, -363.0, 16, 0.0, "コッコロ", 0, 16004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2030/12/17 14:59:59", 1, 0.0, -363.0, 17, 0.0, "コッコロ", 0, 17002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2030/12/17 14:59:59", 1, 0.0, -363.0, 25, 0.0, "キャル", 0, 17004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2030/12/17 14:59:59", 1, 0.0, -363.0, 25, 0.0, "コッコロ", 0, 17005, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2030/12/17 14:59:59", 1, 0.0, -363.0, 25, 0.0, "シェフィ", 2104010, 17006, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2030/12/17 14:59:59", 1, 0.0, -363.0, 25, 0.0, "ペコリーヌ", 0, 17007, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 190801, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2030/12/17 14:59:59", 1, 0.0, -363.0, 18, 0.0, "カリン", 0, 18001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, 190801, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 18, 0.0, "カリン", 0, 18002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (3, 0, 190801, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "2030/12/17 14:59:59", 1, 0.0, -470.0, 19, 0.0, "カリン", 0, 19001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4, 0, 190801, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2030/12/17 14:59:59", 1, 0.0, -470.0, 19, 0.0, "カリン", 0, 19002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5, 0, 190801, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2030/12/17 14:59:59", 1, 0.0, -470.0, 20, 0.0, "カリン", 0, 20001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (6, 0, 190801, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2030/12/17 14:59:59", 1, 0.0, -470.0, 20, 0.0, "カリン", 0, 20002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 21, 0.0, "キャル", 0, 21001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2030/12/17 14:59:59", 1, 0.0, -363.0, 21, 0.0, "コッコロ", 0, 21002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2030/12/17 14:59:59", 1, 0.0, -363.0, 21, 0.0, "シェフィ", 2104010, 21003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 21, 0.0, "ペコリーヌ", 0, 21004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 190801, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2030/12/17 14:59:59", 1, 0.0, -430.0, 22, 0.0, "カリン", 0, 22001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, 190801, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2030/12/17 14:59:59", 1, 0.0, -430.0, 22, 0.0, "カリン", 0, 22002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (3, 0, 190801, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2030/12/17 14:59:59", 1, 0.0, -430.0, 23, 0.0, "カリン", 0, 23001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4, 0, 190801, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2030/12/17 14:59:59", 1, 0.0, -430.0, 23, 0.0, "カリン", 0, 23002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, 109001, 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 4.08, "エリコ（バレンタイン）", 0, 24001, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 10011, 109001, 1, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 5.0, "エリコ（バレンタイン）", 0, 24002, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (3, 10011, 109001, 1, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 10.11, "エリコ（バレンタイン）", 0, 24003, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4, 10011, 109001, 1, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 4.0, "エリコ（バレンタイン）", 0, 24004, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5, 10011, 109001, 1, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 6.0, "エリコ（バレンタイン）", 0, 24005, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (6, 10011, 109002, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "エリコ（バレンタイン）", 0, 24006, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (7, 10011, 109002, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "エリコ（バレンタイン）", 0, 24007, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8, 10011, 109002, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "エリコ（バレンタイン）", 0, 24008, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (9, 10011, 109002, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "エリコ（バレンタイン）", 0, 24009, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (10, 10011, 109002, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "エリコ（バレンタイン）", 0, 24010, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 10011, 109101, 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 2.12, "シズル（バレンタイン）", 0, 24011, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 10011, 109101, 5, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 4.19, "シズル（バレンタイン）", 0, 24012, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (3, 10011, 109101, 2, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2030/12/17 14:59:59", 4, 8.0, -385.0, 24, 2.3, "シズル（バレンタイン）", 0, 24013, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4, 10011, 109102, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "シズル（バレンタイン）", 0, 24014, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5, 10011, 109101, 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 5.23, "シズル（バレンタイン）", 0, 24015, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (6, 10011, 109102, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "シズル（バレンタイン）", 0, 24016, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (7, 10011, 109101, 1, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2030/12/17 14:59:59", 2, 8.0, -385.0, 24, 5.01, "シズル（バレンタイン）", 0, 24017, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8, 10011, 109102, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "シズル（バレンタイン）", 0, 24018, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (9, 10011, 109102, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "シズル（バレンタイン）", 0, 24019, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (10, 10011, 109102, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2030/12/17 14:59:59", 1, 0.0, 0.0, 24, 0.0, "シズル（バレンタイン）", 0, 24020, "2019/01/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "2030/12/17 14:59:59", 1, 0.0, -363.0, 26, 0.0, "シェフィ", 2104010, 26001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 26, 0.0, "ペコリーヌ", 0, 26002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "2030/12/17 14:59:59", 1, 0.0, -363.0, 26, 0.0, "キャル", 0, 26003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", "2030/12/17 14:59:59", 1, 0.0, -363.0, 26, 0.0, "コッコロ", 0, 26004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 2, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", "2030/12/17 14:59:59", 1, 0.0, -363.0, 27, 0.0, "シェフィ", 2104010, 27001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 27, 0.0, "ペコリーヌ", 0, 27002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 27, 0.0, "キャル", 0, 27003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", "2030/12/17 14:59:59", 1, 0.0, -363.0, 27, 0.0, "コッコロ", 0, 27004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 190801, 1, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 28, 0.0, "カリン", 0, 28001, "2019/09/24 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, 190801, 1, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", "2030/12/17 14:59:59", 1, 0.0, -363.0, 28, 0.0, "カリン", 0, 28002, "2019/09/24 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (3, 0, 190801, 1, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", "2030/12/17 14:59:59", 1, 0.0, -409.0, 29, 0.0, "カリン", 0, 29001, "2019/09/24 15:00:00");
