INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (6, 0, 190801, 1, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", "2030/12/17 14:59:59", 1, 0.0, -409.0, 30, 0.0, "カリン", 0, 30002, "2019/09/24 15:00:00");
