INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8, 0, 190801, 1, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", "2030/12/17 14:59:59", 1, 0.0, -409.0, 31, 0.0, "カリン", 0, 31002, "2019/10/31 12:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 190801, 1, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", "2020/01/04 4:59:59", 1, 0.0, -409.0, 32, 0.0, "カリン", 0, 32001, "2019/12/20 5:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, 190801, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2020/01/04 4:59:59", 1, 0.0, -409.0, 32, 0.0, "カリン", 0, 32002, "2019/12/20 5:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (3, 0, 190801, 1, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", "2020/01/04 4:59:59", 1, 0.0, -409.0, 33, 0.0, "カリン", 0, 33001, "2019/12/20 5:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4, 0, 190801, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2020/01/04 4:59:59", 1, 0.0, -409.0, 33, 0.0, "カリン", 0, 33002, "2019/12/20 5:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5, 0, 190801, 1, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", "2020/01/10 11:59:59", 1, 0.0, -409.0, 34, 0.0, "カリン", 0, 34001, "2020/01/04 5:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (6, 0, 190801, 1, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", "2020/01/10 11:59:59", 1, 0.0, -409.0, 34, 0.0, "カリン", 0, 34002, "2020/01/04 5:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", "2030/12/17 14:59:59", 2, 0.0, -458.0, 38, 5.3, "ペコリーヌ", 0, 38001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, 105801, 1, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", "2030/12/17 14:59:59", 2, 0.0, -458.0, 38, 6.5, "ペコリーヌ", 0, 38002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, 0, 105801, 3, "", "2020/04/08 23:59:59", 3, 9999.0, 9999.0, 39, 0.0, "ペコリーヌ", 0, 39005, "2020/04/01");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2, 0, 190801, 1, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", "2030/12/17 14:59:59", 1, 0.0, -430.0, 40, 0.0, "カリン", 0, 40001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 1, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", "2030/12/17 14:59:59", 1, 0.0, -363.0, 41, 0.0, "シェフィ", 2104010, 41001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 41, 0.0, "ペコリーヌ", 0, 41002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", "2030/12/17 14:59:59", 1, 0.0, -363.0, 41, 0.0, "キャル", 0, 41003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", "2030/12/17 14:59:59", 1, 0.0, -363.0, 41, 0.0, "コッコロ", 0, 41004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "2030/12/17 14:59:59", 1, 0.0, -416.5, 42, 0.0, "コッコロ", 0, 42001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106401, 1, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", "2030/12/17 14:59:59", 1, 0.0, -416.5, 42, 0.0, "シェフィ", 2104010, 42002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "2030/12/17 14:59:59", 1, 0.0, -416.5, 42, 0.0, "ペコリーヌ", 0, 42003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", "2030/12/17 14:59:59", 1, 0.0, -416.5, 42, 0.0, "キャル", 0, 42004, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105801, 1, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 43, 0.0, "ペコリーヌ", 0, 43001, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 105901, 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "2030/12/17 14:59:59", 1, 0.0, -363.0, 43, 0.0, "コッコロ", 0, 43002, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 106001, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "2030/12/17 14:59:59", 1, 0.0, -363.0, 43, 0.0, "キャル", 0, 43003, "2015/12/17 15:00:00");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (1, 0, 123001, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "2030/12/17 14:59:59", 1, 0.0, -416.5, 44, 0.0, "アメス", 0, 43004, "2015/12/17 15:00:00");
